    <script>
        var questionChanges = [];

        function updateBoolean(type_id, object_id, state, value) {
            questionChanges[type_id + '-' + object_id + '-' + state] = {
                type_id: type_id,
                object_id: object_id,
                state: state,
                value: value
            };
            if (state === 'required' && value === true) {
                if ($('#type_' + type_id + '_enabled_' + object_id + ':checked').length === 0) {
                    $('#type_' + type_id + '_enabled_' + object_id).click();
                }
            } else if (state === 'enabled' && value === false) {
                var element = $('#type_' + type_id + '_required_' + object_id);
                if (element.is(':checked')) {
                    element.click();
                }
            }
            countQuestions();
        }

        function processChanges() {
            if (countQuestions() === false) {
                system.alert(
                    'Select the correct number of questions',
                    'Enabled questions 12 ≥<br>Required questions = 4'
                );
            } else {
                system.showLoading();

                var changes = [];
                for (var key in questionChanges) {
                    if (questionChanges.hasOwnProperty(key)) {
                        changes.push(questionChanges[key]);
                    }
                }

                $.post(
                    '/json/question/updateBoolean', {
                        changes: changes
                    },
                    function(response) {
                        console.log(response);
                        system.hideLoading();
                        toggleEdit();
                    }
                );
            }
        }

        function toggleEdit() {
            var editButton = $('#edit_questions');
            var saveButton = $('#save_questions');
            var gridEdit = '';
            if (editButton.text() === 'edit') {
                editButton.html('<i class="material-icons">close</i>').addClass('cancel');
                saveButton.show();
                gridEdit = '&editGrid=1';
            } else {
                editButton.html('<i class="material-icons">edit</i>').removeClass('cancel');
                saveButton.hide();
                gridEdit = '&editGrid=0';
            }

            var grid = $(question_overview);
            var url = grid.getGridParam('url').replace('&editGrid=1', gridEdit).replace('&editGrid=0', gridEdit);
            var data = grid.getGridParam('postData');
            $.each(data, function(key, value) {
                url += "&" + key + "=" + encodeURIComponent(value);
            });
            grid.setGridParam({
                url: url,
                page: 1
            });
            grid.trigger("reloadGrid");
            questionChanges = [];
        }

        function countQuestions() {
            var tree = {
                4: {
                    type_1_required: ['.type_1_required:checked', '.type_1_required_boolean'],
                    type_2_required: ['.type_2_required:checked', '.type_2_required_boolean'],
                    type_3_required: ['.type_3_required:checked', '.type_3_required_boolean'],
                },
                12: {
                    type_1_enabled: ['.type_1_enabled:checked', '.type_1_enabled_boolean'],
                    type_2_enabled: ['.type_2_enabled:checked', '.type_2_enabled_boolean'],
                    type_3_enabled: ['.type_3_enabled:checked', '.type_3_enabled_boolean'],
                }
            }
            var submittable = true;
            var amount, containerId, container, checked;
            for (amount in tree) {
                if (tree.hasOwnProperty(amount)) {
                    for (containerId in tree[amount]) {
                        if (tree[amount].hasOwnProperty(containerId)) {
                            container = $('#' + containerId);
                            checked = $(tree[amount][containerId].join(',')).length;
                            container.text(checked + '/' + amount);
                            if (checked < amount || (amount == 4 && checked > amount)) {
                                container.css('color', 'red');
                                submittable = false;
                            } else {
                                container.css('color', '#3b8e3b');
                            }
                        }
                    }
                }
            }
            return submittable;
        }
    </script>
</main>
